/users":\n    var outUsers = @[newUser()]\n    dbConn.selectAll(outUsers)\n\n    var response = %*[]\n    for i in outUsers:\n      response.add %*{\n        "id": i.id,\n        "lastLogin": $i.lastLogin\n      }\n    return response\n'),Field3:"nim_sqlite_full",Field4:newPlayResult_3355443208([])},NTI3992978943),nimCopy(null,{Field0:[80,121,116,104,111,110],Field1:[112,121,116,104,111,110],Field2:makeNimstrLit('from happyxpy import Server\nfrom sqlalchemy import create_engine, Column, Integer, DateTime\nfrom sqlalchemy.ext.declarative import declarative_base\nfrom sqlalchemy.orm import sessionmaker\nfrom datetime import datetime\n\n\nBase = declarative_base()\nengine = create_engine("sqlite:///users.db")\nSessionLocal = sessionmaker(autocommit=False, autoflush=False, bind=engine)\nBase.metadata.create_all(bind=engine)\n\n\nclass User(Base):\n    __tablename__ = "users"\n    id = Column(Integer, primary_key=True, index=True)\n    lastLogin = Column(DateTime)\n\n\napp = Server(\'127.0.0.1\', 5000)\n\n\n@app.post("/user/new")\ndef create_user():\n    user = User(lastLogin=datetime.now())\n    db = SessionLocal()\n    db.add(user)\n    db.commit()\n    db.refresh(user)\n    db.close()\n    return {"response": "success"}\n\n\n@app.get("/user/id{user_id:int}")\ndef read_user(user_id: int):\n    db = SessionLocal()\n    user = db.query(User).filter(User.id == user_id).first()\n    db.close()\n    if user is None:\n        return {"response": "failure"}\n    return {"id": user.id, "lastLogin": user.lastLogin}\n\n\n@app.get("/users")\ndef read_users():\n    db = SessionLocal()\n    users = db.query(User).all()\n    db.close()\n    response = []\n    for user in users:\n        response.append({"id": user.id, "lastLogin": user.lastLogin})\n    return response\n\n\napp.start()\n'),Field3:"py_sqlite_full",Field4:newPlayResult_3355443208([])},NTI3992978943)])),u=registerComponent_2164263966(toJSStr(0==scopedCycleCounter_2164260966[0]?[99,111,109,112,57,53,57,57,54,49,49,57,49,